import React from 'react'
import styled from 'styled-components'

const SearchWrapper = styled.div``

const Search = styled.input`
  border-radius: 10px;
  background-color: #f5efe5;
  width: 70%;
  padding: 10px 30px;
  margin: 8px;

  &::placeholder {
    content: 'Search...';
    color: gray;
  }
`

const SearchInput = () => {
  return (
    <div>
      <Search type='search' className='rounded-search-input' />
    </div>
  )
}

export default SearchInput
